import React from "react";

function Header() {
  return (
    <div className="header">
      <nav>
        <a href="#1">HOME</a>
        <a href="#2">ABOUT ME</a>
        <a href="#3">PROJECTS</a>
        <a href="#4">SERVICES</a>
        <a href="#5">CONTACT ME</a>
      </nav>
    </div>
  );
}

export default Header;
